/* global Ext, futureLang */
Ext.define('Entidades.view.EditEntidad', {
    extend: 'Ext.window.Window',
    alias: 'widget.edit_entidad',
    layout: {
        type: 'vbox',
        align: 'stretch'
    },
    modal: true,
    resizable: false,
    closeAction: 'hide',
    width: 750,
    DEFAULT_IMAGE: 'data:image/jpg;base64,',
    initComponent: function() {
        var me = this;
        this.cbdpa = Ext.create('Ext.ux.TreeCombo', {
            fieldLabel: futureLang.lbDpa,
            id: 'iddpa',
            name: 'iddpa',
            treeWidth: 270,
            width: 140,
            rootVisible: false,
            store: Ext.create('Ext.data.TreeStore', {
                model: 'Entidades.model.Dpa',
                id: 'idsttreecombodpa',
                defaultRootId: 0,
                autoLoad: true,
                autoSync: false,
                proxy: {type: 'ajax', url: 'loaddatadpa', reader: {type: 'json', root: 'data'}},
                root: {expanded: false},
                folderSort: false,
                sorters: [{property: 'codigo', direction: 'ASC'}]
            }),
            selectChildren: false,
            canSelectFolders: true,
            allowBlank: false,
            displayField: 'text',
            valueField: 'id',
            editable: false,
            treeColumns: [{
                    dataIndex: 'idpadre',
                    hidden: true
                }, {
                    dataIndex: 'id',
                    hidden: true
                }, {
                    xtype: 'treecolumn', //this is so we know which column will show the tree
                    text: futureLang.lbCodigo,
                    width: 80,
                    sortable: true,
                    dataIndex: 'codigo'
                }, {
                    text: futureLang.lbDenominacion,
                    flex: 1,
                    dataIndex: 'text',
                    sortable: true
                }]
        });
        this.items = [
            {
                xtype: 'form',
                itemId: 'basic_data',
                region: 'center',
                margins: '5 5 5 5',
                fieldDefaults: {
                    labelAlign: 'top',
                    msgTarget: 'side',
                    anchor: '100%',
                    labelWidth: 70
                },
                frame: true,
                border: false,
                bodyPadding: '5 5 0',
                layout: {
                    type: 'vbox',
                    align: 'stretch'
                },
                items: [
                    {
                        xtype: 'hidden',
                        name: 'identidad'
                    },
                    {
                        xtype: 'container',
                        layout: {
                            type: 'hbox',
                            align: 'stretch'
                        },
                        items: [
                            {
                                xtype: 'container',
                                anchor: '100%',
                                layout: 'vbox',
                                margins: '0 10 0 0',
                                items: [
                                    {
                                        xtype: 'image',
                                        name: 'foto',
                                        width: 140,
                                        height: 122,
                                        style: {
                                            cursor: 'pointer',
                                            border: '1px solid #5FA2DD'
                                        },
                                        src: this.DEFAULT_IMAGE,
                                        listeners: {
                                            click: {
                                                element: 'el',
                                                fn: function() {
                                                    Ext.get('uploadFoto').dom.click();
                                                }
                                            }
                                        }
                                    }
                                ]
                            },
                            {
                                xtype: 'container',
                                flex: 1,
                                layout: 'anchor',
                                margins: '-7 0 0 0',
                                items: [
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                name: 'nombre',
                                                fieldLabel: futureLang.lbNombre,
                                                margins: '0 5 0 0',
                                                maskRe: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]*)+$/,
                                                regex: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]*)+$/,
                                                flex: 1,
                                                maxLength: 255,
                                                allowBlank: false
                                            },
                                            {
                                                width: 200,
                                                name: 'abreviatura',
                                                fieldLabel: futureLang.lbAbreviatura,
                                                maskRe: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]*)+$/,
                                                regex: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \"\-\_\(\)\.\#\,]*)+$/,
                                                maxLength: 50,
                                                allowBlank: false
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                flex: 1,
                                                name: 'descripcion',
                                                fieldLabel: futureLang.lbDescripcion,
                                                maskRe: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]*)+$/,
                                                regex: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]*)+$/,
                                                maxLength: 255,
                                                allowBlank: false
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                name: 'reeup',
                                                fieldLabel: futureLang.lbCodigoReeup,
                                                margins: '0 5 0 0',
                                                flex: 1,
                                                maxLength: 11,
                                                maskRe: /[\d\.]/i,
                                                regex: /^[\d\.]{11}$/,
                                                allowBlank: true
                                            },
                                            {
                                                name: 'nit',
                                                margins: '0 5 0 0',
                                                flex: 1,
                                                fieldLabel: futureLang.lbCodigoNit,
                                                maxLength: 11,
                                                maskRe: /[\d\.]/i,
                                                regex: /^[\d\.]{11}$/,
                                                allowBlank: true
                                            },
                                            {
                                                width: 200,
                                                name: 'telefonos',
                                                fieldLabel: futureLang.lbTelefonos,
                                                maxLength: 255,
                                                minLength: 8,
                                                allowBlank: true,
                                                vtype: 'phones'
                                            }
                                        ]
                                    }
                                ]
                            }
                        ]
                    }, {
                        xtype: 'container',
                        layout: {
                            type: 'hbox',
                            align: 'stretch'
                        },
                        items: [
                            {
                                xtype: 'container',
                                flex: 1,
                                layout: 'anchor',
                                items: [
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                name: 'correos',
                                                fieldLabel: futureLang.lbCorreos,
                                                margins: '0 5 0 0',
                                                flex: 1,
                                                maxLength: 255,
                                                vtype: 'emails',
                                                allowBlank: true
                                            },
                                            {
                                                name: 'web',
                                                fieldLabel: futureLang.lbSitioWeb,
                                                flex: 1,
                                                maxLength: 255,
                                                vtype: 'url',
                                                allowBlank: true
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            this.cbdpa,
                                            {
                                                xtype: 'displayfield',
                                                fieldLabel: futureLang.lbDpaextendido,
                                                name: 'dpaext',
                                                value: futureLang.lbNotDpa,
                                                margins: '3 5 5 10',
                                                fieldStyle: 'font-size:12px',
                                                flex: 1
                                            },
                                            {
                                                name: 'geoid',
                                                fieldLabel: futureLang.lbGeoId,
                                                width: 200,
                                                maxLength: 50,
                                                maskRe: /[\d\.]/i,
                                                regex: /^[\d\.]{50}$/,
                                                allowBlank: true
                                            }
                                        ]
                                    },
                                    {
                                        xtype: 'fieldcontainer',
                                        layout: 'hbox',
                                        defaultType: 'textfield',
                                        anchor: '100%',
                                        items: [
                                            {
                                                fieldLabel: futureLang.lbDireccion,
                                                name: 'direccion',
                                                maxLength: 255,
                                                maskRe: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]*)+$/,
                                                regex: /^([a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]+ ?[a-zA-Z0-9\xf3\xf1\xe1\xe9\xed\xfa\xd1\xc1\xc9\xcd\xd3\xda\xfc\s \/\%\"\-\_\(\)\.\#\,\ ]*)+$/,
                                                allowBlank: true,
                                                flex: 1
                                            }
                                        ]
                                    }
                                ]
                            }
                        ]
                    }



                ]
            }
        ];

        this.buttons = [
            {
                text: Ext.lang.btnAcept,
                action: 'aceptar'
            }, {
                text: Ext.lang.btnCancel,
                action: 'cancelar',
                scope: this,
                handler: this.close
            }
        ];

        this.callParent(arguments);

        Ext.get('uploadFoto').on('change', function(f, value, opt) {
            var file = f.target.files[0];
            var reader = new FileReader();
            reader.onload = function(evt) {
                var fileData = evt.target.result;
                var bytes = new Uint8Array(fileData);
                var base64Img = Base64.encodeByteArray(bytes);
                me.down('image[name=foto]').setSrc('data:image/jpg;base64,' + base64Img);
            };
            reader.readAsArrayBuffer(file);
        });
    }
});